import styled from 'styled-components';

export const BurgerIngridients = styled.div`
    background-color: blue;
    width: 100%;
    height: calc(100% - 50px);
    overflow-y: scroll;
    &::-webkit-scrollbar {
        display: none;
    }
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    padding-top: 200px;
`
